import React from 'react'
import { HomeOptions } from './OptionsFolder/homeOptions'
import { Home } from './home'
import { createBrowserRouter, Route, Routes } from "react-router-dom";
import { CompletedRutesComponent } from './completedRutesFolder/completedRutesComponent';


export const AppRutes = () => {

  return (

    <>
        <HomeOptions/>
        <Routes>

          <Route path = 'home' element = { <Home/> }></Route>

          <Route path = 'completed' element = { <CompletedRutesComponent rutesCompleted={rutesCompleted} /> }></Route>

        </Routes>
         
    </>


  )


}
